function loadMasterPages(e){$.get(e,function(e){pagePlaceholders=$(document).find("Content");var t=document.open("text/html","replace");t.write(e),t.close(),$(t).find("ContentPlaceHolder").each(function(){var e=this;pagePlaceholders.each(function(){e.id==$(this).attr("ContentPlaceHolderID")&&$(e).replaceWith(this)})})})}$(document).ready(function(){loadMasterPages($("script[MasterPageFile]").attr("MasterPageFile"))});
